function getWeatherInformaion() {
    var url = "https://api.openweathermap.org/data/2.5/weather?q=Budapest,hu&appid=0283685587f03ff03d7ac58d1938315f";
    $.ajax({
        type: 'GET',
        url: url,
        success: function(data){
            // console.log('data: '+JSON.stringify(data));
            icon=data.weather[0].icon;
            if (icon=='01d' || icon=='02d' || icon=='03d' || icon=='04d' || icon=='09d' || icon=='10d' || icon=='11d' || icon=='13d' || icon=='50d' || icon=='600d' ||
                icon=='01n' || icon=='02n' || icon=='03n' || icon=='04n' || icon=='09n' || icon=='10n' || icon=='11n' || icon=='13n' || icon=='50n' || icon=='600n') {
                iconkep=icon;
            } else {
                iconkep='ures';
            }
            // console.info('ikon: '+icon);

            temperature = (!data || !data.main || !data.main.temp) ? 0 : data.main.temp - 273.15;
            temperature = Math.round(temperature);
            $('#idojaras_fok').text(temperature);
            $('#idojaras_kep').html('<img src="/design/mindenki/ikonok/idojaras/'+iconkep+'.png" style="width: 100%;" title="'+icon+'" />');
            // $(".weather_temperature").html(temperature + "<sup>0</sup>");
        }
    });
}

