function kereses(tipus,mezo,urlpref) {
    if (urlpref===undefined) {
        urlpref='';
    }
    if (tipus=='desktop') {
        filter='';
        if($('#'+mezo).val()) {
            filter='?key='+$('#'+mezo).val();
        }
        if (mezo=='search-input3') { // reszletes kereso
            if($('#date_tol').val()) {
                filter=filter+'&tol='+$('#date_tol').val();
            }
            if($('#date_ig').val()) {
                filter=filter+'&ig='+$('#date_ig').val();
            }
            if ($('#igazgatosagokbanis').is(':checked')) {
                filter=filter+'&igazgatosagokbanis=igen';
            }
            if ($('#kj').is(':checked')) { filter=filter+'&kj=igen'; } else { filter=filter+'&kj=nem'; }
            if ($('#km').is(':checked')) { filter=filter+'&km=igen'; } else { filter=filter+'&km=nem'; }
            if ($('#kh').is(':checked')) { filter=filter+'&kh=igen'; } else { filter=filter+'&kh=nem'; }
            if ($('#sorrend2').is(':checked')) {
                filter=filter+'&sorrend2=igen';
            }
        }
        location.href = urlpref+"/kereso"+filter;
    }
    if (tipus=='mobil') {
        location.href = urlpref+'/kereso?key='+$('#search-input-mobile').val();
    }
}

