function nyomtatasframe(divid) {
    // var contents = document.getElementById(divid).innerHTML;
    var frame1 = document.createElement('iframe');
    frame1.name = "frame1";
    frame1.style.position = "absolute";
    frame1.style.top = "-1000000px";
    document.body.appendChild(frame1);
    var frameDoc = frame1.contentWindow ? frame1.contentWindow : frame1.contentDocument.document ? frame1.contentDocument.document : frame1.contentDocument;

    frameDoc.document.write('<html><head><title>' + document.title  + '</title>');
    frameDoc.document.write('<style type="text/css">');
    frameDoc.document.write('BODY { font-size: 16px; }');
    frameDoc.document.write('H1 { display: none; }');
    frameDoc.document.write('H2 { color: #000000; }');
    frameDoc.document.write('.noprint { display: none; }');
    frameDoc.document.write('IFRAME { display: none; }');
    frameDoc.document.write('IMG { max-width: 100%; }');
    frameDoc.document.write('</style>');
    frameDoc.document.write('</head><body >');
    frameDoc.document.write('<h2>' + document.title  + '</h2>');
    frameDoc.document.write(document.getElementById(divid).innerHTML);
    frameDoc.document.write('</body></html>');

    frameDoc.document.close();

    setTimeout(function () {
        window.frames["frame1"].focus();
        window.frames["frame1"].print();
        document.body.removeChild(frame1);
    }, 500);
    return false;
}

function nyomtatas(elem) {
    var mywindow = window.open('', 'PRINT', 'height=600,width=600');
    mywindow.document.write('<html><head><title>' + document.title  + '</title>');
    // mywindow.document.write('<link href="/design/mindenki/css/nyomtatas.css?7" rel="stylesheet">');
    mywindow.document.write('<style type="text/css">');
    mywindow.document.write('BODY { font-size: 16px; }');
    mywindow.document.write('H1, H2 { color: #000000; }');
    mywindow.document.write('.noprint { display: none; }');
    mywindow.document.write('IFRAME { display: none; }');
    mywindow.document.write('IMG { max-width: 100%; }');
    mywindow.document.write('</style>');
    mywindow.document.write('</head><body >');
    mywindow.document.write('<h1>' + document.title  + '</h1>');
    mywindow.document.write(document.getElementById(elem).innerHTML);
    mywindow.document.write('</body></html>');
    mywindow.document.close(); // necessary for IE >= 10
    mywindow.focus(); // IE >= 10
    mywindow.print();
    mywindow.close();
    return true;
}
